    false,nt"url": null,nt"notes": "This narrative report for Mingo National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1956.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, raptors, fish, and reptiles- is
    also covered. The Refuge development and maintenance section discusses physical
    developments and plantings. A progress report on field investigations and applied
    research is also provided. The public relations section discusses recreational uses,
    Refuge visitors, Refuge participation, and fishing.  N-R forms and photographs are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
